import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  background: #ffffff;
  height: 72px;
  align-items: center;
  justify-content: space-between;
  padding: 0 70px;
`;

export const Logo = styled.div`
  img {
    width: 130px;
  }
`;

export const Nav = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 412px;
`;

export const Actions = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 412px;
`;
